  ["pepperers"] = "<html><body><h1>pepperers</h1><p>n.<p></p>pepper的变形<p></p>胡椒香料商<p></p>有胡椒味的东西<p></p>[比喻]性格暴躁的人<p></p>pepper<p></p>['pepə]<p></p>n.<p></p>【植物】胡椒属 (Piper nigrum)植物<p></p>辣椒;辣椒属 (Capsicum frutescens)<p></p>胡椒；胡椒粉<p></p>【植物】各种具有芳香辛辣味的植物[如桃金娘科 (Myrtaceae)，姜科 (Zingiberaceae) 植物等]<p></p>辣椒籽[参较 red pepper, green pepper, sweet pepper]<p></p>胡椒瓶<p></p>辛辣(或富有刺激性)的事物<p></p>活力；劲头；胆量<p></p>[美国英语]【棒球】(赛前的)热身投击球练习[亦作 pepper game]<p></p>[美国俚语、贬义]墨西哥佬<p></p>adj.<p></p>【植物】胡椒属植物的；胡椒的<p></p>vt.<p></p>加胡椒粉于；撒胡椒粉调料：<p></p>You don't have to pepper the soup.<p></p>你不一定要在汤里撒胡椒面。<p></p>雨点般地撒；密布：<p></p>The wall had been peppered with stains.<p></p>墙上满是污痕。<p></p>密击；连续打击：<p></p>a roof peppered with hailstones<p></p>冰雹猛击下的屋顶<p></p>He peppered the wild ducks with bird shot.<p></p>他用鸟枪向野鸭子射击。<p></p>殴打；鞭打：<p></p>Smith peppered his opponent with long right.<p></p>史密斯用右手长拳痛击对手。<p></p>使活跃；使(文章等)辛辣(或有煽动性)：<p></p>David peppered the audience with an anti-inflation speech.<p></p>大卫做反通货膨胀的演说鼓动听众。<p></p>[美国俚语]【棒球】快速直投(球)；【高尔夫球】猛击球：<p></p>He peppered the ball across the green.<p></p>他一下子把球猛击过草地。<p></p>短语:<p></p>take pepper in the nose 或 grow pepper<p></p>[废语]发怒，发脾气，勃然大怒，动气</p></body></html>",
