  ["playlike"] = "<html><body><h1>playlike</h1><p>playlike<p></p>adj.<p></p>play的变形<p></p>play<p></p>[plei]<p></p>vi.<p></p>(动物)飞舞；轻快地动；跳来蹦去：<p></p>Bees play<p></p>about flowers.<p></p>蜜蜂在花上飞来飞去。<p></p>(浪、光等)闪动；照耀；飘动；荡漾；摇晃：<p></p>sunlight playing on the waves<p></p>照耀在水波面上的阳光<p></p>(微笑等)浮泛(在脸上等)；静静地过去：<p></p>A smile plays on her lips.<p></p>她嘴唇上浮泛着微笑。<p></p>娱乐；游戏；玩，玩耍：<p></p>Ken's mother won't let him go out and play.<p></p>肯的母亲不让他出去玩。<p></p>进行体育(或文娱)比赛；会某种体育活动；走棋；出牌；(运动员)以特定的方式做动作；(场地等)呈特定使用状态：<p></p>He was invited for a game of poker, but he refused to play.<p></p>他被邀去玩扑克牌， 但是他拒绝去打牌。<p></p>The lawn plays well.<p></p>草地适于打球。<p></p>赌博；打赌：<p></p>to play for money<p></p>赌钱<p></p>玩弄人(或物)；作弄，戏弄；开玩笑：<p></p>The boy played with his toy train.<p></p>这孩子玩弄他的玩具火车。<p></p>演奏(乐器)；弹奏；奏响；发出声音(尤指乐器奏鸣声)：<p></p>At that moment,the band began playing.<p></p>就在那时，乐队开始演奏。<p></p>表演；演出；扮演角色：<p></p>This is a drama that does not play<p></p>well.<p></p>这是一出没有演好的戏。<p></p>装扮；(尤指)假装：<p></p>He played dead.<p></p>他装死。<p></p>行动，举动；处置：<p></p>Her hand was playing on the edge of the bed.<p></p>她的手在床边抚摸着。<p></p>(戏剧)上演；(电台)广播：<p></p>The movie is playing in Beijing.<p></p>这部影片正在北京上演。<p></p>(机器部件等)运转自如：<p></p>The wheel plays in a track.<p></p>轮子在轨道上转动。<p></p>(接连)发射；喷射；照射 (与 on， over 或 along 连用)：<p></p>Scores of hoses played on the flames.<p></p>几十根水龙带向火喷水。<p></p>施加影响：<p></p>See that direct heat does not play on it.<p></p>当心别让它直接受热。<p></p>(唱片、磁带等)放音：<p></p>The radio was playing loudly.<p></p>无线电音量开得很大。<p></p>[俚语]照办；合作：<p></p>They'd come back and get her, if I didn't play with them.<p></p>如果我同他们合作，他们还会再来抓她的。<p></p>[方言]停工；罢工；休假<p></p>vt.<p></p>参加比赛，同…比赛；对抗：<p></p>We are playing the Red Star School Team next Sunday.<p></p>下星期日我们将同红星校队比赛。<p></p>【体育】<p></p>(体育比赛)站在(特定位置)，(让…)担任(特定位置)：<p></p>He played centre forward.<p></p>他担任中锋。<p></p>使…上阵；使参加比赛：<p></p>The coach played him at centre.<p></p>教练叫他担任中锋。<p></p>【体育】<p></p>击球，定(球)的方向：<p></p>to play a wedge shot to the green<p></p>用楔形球棒朝草地方向击球<p></p>【棒球】拾(球)，接(球)：<p></